// SPDX-License-Identifier: SimPL-2.0

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";

contract EMemoryToken is ERC20 {
    using SafeMath for uint256;
    uint256 public constant _total_stage = 700000000;

    uint256 private _stage;
    address private _owner;

    uint256[] public DONATION_RATE = [
        15000, 20000, 30000, 35000
    ];

    event Donation(uint256 value, uint256 amount);

    constructor() ERC20("eMMC", "eMMC") {
        _owner = msg.sender;

        uint256 supply = 280 * 1000000;
        uint256 decimal = 10 ** uint256(decimals());
        _mint(msg.sender, supply * decimal);
    }

    modifier OnlyOwner() {
        require(msg.sender == _owner, "MMC-INFO: Only owner.");
        _;
    }

    function setStage(uint8 stage) public OnlyOwner {
        _stage = stage;
    }

    function donation() payable public {
        uint256 decimal = 10 ** uint256(decimals());

        uint256 stage = DONATION_RATE[_stage].mul(decimal);
        uint256 totalStage = _total_stage.mul(decimal);

        uint256 rate = totalStage.div(stage);
        uint256 realAmount = msg.value.mul(rate);

        IERC20(address(this)).transfer(msg.sender, realAmount);
        emit Donation(msg.value, realAmount);
    }
}
